import PropTypes from "prop-types";
import styles from "./04_archive.module.css";
import common_styles from "./common.module.css";

const Archives = ({ className = "" }) => {
  return (
    <div className={common_styles.columnContainer}>
      <div className={common_styles.columnContainerChild} />
      <a className={common_styles.columnTitle}>archive</a>
      <div className={styles.archiveContainer}>
        <div className={styles.archiveItem}>
          <iframe width="560" height="315" src="https://www.youtube.com/embed/bZ9m6My9opE?si=n9n0JIU_TYjB3T9W" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>  
        </div>
      </div>
    </div>
  );
};

Archives.propTypes = {
  className: PropTypes.string,
};

export default Archives;
